import React from 'react';
import "./side_menu.css";

export class SideMenu extends React.Component  {



    render() {


        return <> 
            <div className="position-sticky z-1">
                <div className="w-10 float-right bg-nav vh-75 text-light">
                    <div className="float-right w-100">
                        <p className="h3 text-right mb-5 border-top border-secondary">Profile</p>
                        <p className="h3 text-right border-bottom border-secondary">Dashboard</p>
                        <p></p>
                    </div>
                </div>
                <div className="float-none"></div>
            </div>
        </>;
    }
}
